import React from "react";

const TokyoDogRunPage: React.FC = () => {
  return (
    <div>
      <h1>東京のドッグラン一覧</h1>
      <div>
      <p>東京にあるおすすめドッグランの情報をご紹介してます</p>
      </div>
      <div className="dogrun-first">
        <p className="dogrun-name">つばさドッグラン</p>
        <p className="time">開店時間：閉店時間</p>
        <p className="address">住所</p>
       <p>定休日 無休</p>
        <p>公式サイト</p>
      </div>
    </div>


  );
};

export default TokyoDogRunPage;
